enum ErrorKind {
    Syntax(String),
    Unsupported(String),
    Serialize(String),
    StateIDOverflow {
            max: usize,
        },
    PremultiplyOverflow {
            max: usize,
            requested_max: usize,
        },
}

enum State {
    Range {
            range: Transition,
        },
    Sparse {
            ranges: Box<[Transition]>,
        },
    Union {
            alternates: Box<[StateID]>,
        },
    Fail,
    Match,
}

enum SparseDFA<T, S = usize> where T: AsRef<[u8]>, S: StateID {
    Standard(Standard<T, S>),
    ByteClass(ByteClass<T, S>),
    __Nonexhaustive,
}
